import {
    StyleSheet,
  } from 'react-native';


  const Styles = StyleSheet.create({
    container: {
      flex: 1,
      alignItems: 'center',
      justifyContent: 'center',
    },
    title: {
      fontSize: 20,
      fontWeight: 'bold',
    },
    separator: {
      marginVertical: 30,
      height: 1,
      width: '80%',
    },
    separatorLine: {
      height: 1,
      backgroundColor: 'white',
    },
  });

export default Styles;
